script: |
  super -f text -I q3355.spq | sort > q3355.out

inputs:
  - name: q3355.spq
    data: |
      SELECT - col2, + col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 * - col0 BETWEEN + col0 AND NULL;
  - name: tab1

outputs:
  - name: q3355.out
    data: |
      -59	59
      -68	68
      -96	96
